/*Data for the table `postinfo` */

insert  into `postinfo`(`PostId`,`user_id`,`PostTitle`,`Topic`,`PostMessage`,`PostDate`,`Views`,`Likes`) values (1,'ysoni01','Game Of Thrones','Others','Game of Thrones new season is set to start on 24th April and with the winter coming soon, HBO just released a new trailer. Westeros is set to witness huge clashes that are going to be fought on paper and in courtrooms as well. The Lannisters are definitely going to repay their debts but with the White Walkers set to wreak havoc in the North, things don\'t look great for a lot of people.\r\n\r\n<br><br>Here\'s what we see in the new trailer: the return of Walder Frey, a blind Arya being given a second chance by Jaqen H‚Äôghar, The White Walker army and Tyrion Lannister being... well.. himself.\r\n\r\n<br><br>Game of Thrones is an American fantasy drama television series created by showrunners David Benioff and D. B. Weiss. It is an adaptation of A Song of Ice and Fire, George R. R. Martin\'s series of fantasy novels, the first of which is titled A Game of Thrones. It is filmed in a Belfast studio and on location elsewhere in Croatia, Iceland, Malta, Morocco, Northern Ireland, Spain, Scotland, and the United States, and premiered on HBO in the United States on April 17, 2011. The series has been renewed for a sixth season, which will premiere on April 24, 2016','2016-04-07',567,20),(2,'ysoni01','Arjun Vajpai - The Child Prodigy','Sports','At an age where most of us are confused about what to do in life, this boy of 16 had his dreams panned out before him. I am talking about the young prodigy from Delhi, Arjun Vajpai, who holds the distinction of being one of the youngest Indians to have climbed the Mount Everest in 2010.\r\n\r\n\"The odds were against me. History was against me\", says Vajpai, talking about how challenging it was to prepare for the climb\r\n\r\nIt took Vajpai a year to prepare for Mount Everest. \"Ever since I was 10, I\'ve wanted to achieve this feat and I\'m so glad my parents were supportive of my dreams. There haven\'t been many youngsters to have climbed the Everest and I took that as a challenge and I\'m fortunate enough to have become the third youngest Indian to achieve this feat\", said Vajpai.\r\n\r\n<br>\r\n<br>\r\n<br>\r\n<br>\r\nA child prodigy from Delhi, Arjun Vajpai, who holds the distinction of being one of the youngest Indians to have climbed the Mount Everest in 2010.\r\n<br><br>\r\nThe odds were against me. History was against me, says Vajpai, talking about how challenging it was to prepare for the climb\r\n<br><br>\r\nIt took Vajpai a year to prepare for Mount Everest. Ever since I was 10, I‚Äôve wanted to achieve this feat and I‚Äôm so glad my parents were supportive of my dreams. There haven‚Äôt been many youngsters to have climbed the Everest and I took that as a challenge and I‚Äôm fortunate enough to have become the third youngest Indian to achieve this feat, said Vajpai.','2016-04-07',181,7),(3,'suyashsoni71','Prince William and Kate Middleton in India','Politics','In India for a week-long trip, Prince William and Kate Middleton attended a gala thrown by \r\nThe British High Commission in partnership with the British Asian Trust - Prince Charles\' \r\ncharity - and the Taj Mahal Palace hotel in Mumbai, where practically all of Bollywood \r\nhobnobbed with them. Neither you nor we were invited, of course, so it\'s imperative that \r\nwe obsess over these pictures and try to figure out possible conversations between the \r\nDuke and Duchess, and our celebrities','2016-04-07',192,15),(4,'jain.prachi94','5 Reasons Why Its Awesome To Work In A Start-Up ','Technology','A start-up organization is easy to identify, thanks to its colorful office\r\nHere are some reasons why working in a start-up is awesome:\r\n<pre>\r\n\r\n1. Literally everyone is of the same age, even the bosses.\r\n2.  There\'s no room for boredom because you will have a new thing to do every day.\r\n3. Unlike in conventional companies, here your work is ALWAYS recognized.\r\n4. Wear what you like, no one will ever judge you.\r\n5. Free food. Need I say more?\r\n</pre>','2016-04-07',115,25),(7,'ysoni01','yahoo','Technology','Yahoo Inc. is an American multinational technology company headquartered in Sunnyvale, California. It is globally known for its Web portal, search engine Yahoo! Search, and related services, including Yahoo! Directory, Yahoo! Mail, Yahoo! Wikipedia\r\nYahoo Inc. (styled as Yahoo!) is an American multinational technology company headquartered in Sunnyvale, California. It is globally known for its Web portal, search engine Yahoo! Search, and related services, including Yahoo! Directory, Yahoo! Mail, Yahoo! News, Yahoo! Finance, Yahoo! Groups, Yahoo! Answers, advertising, online mapping, video sharing, fantasy sports and its social media website. It is one of the most popular sites in the United States.[9] According to third-party web analytics providers, Alexa and SimilarWeb, Yahoo! is the highest-read news and media website, with over 7 billion readers per month','2016-04-08',53,3);

